import Item from "./Item"
import {nanoid } from "nanoid"
function List({show}) {
  console.log(show)
    return (
      <div className="list">
        {show.map((item)=>{
        const{date,time,content}=item;
        return (
          <Item key={nanoid()} date={date} time={time} content={content}/>
        );
        })} 
      </div>
      )
  }

  export default List;
